import React, { Component } from 'react'
import ListItem from './ListItem'

const initialItems = [
    "Milk",
    "Coffee",
    "Tea",
    "Eggs"
]

const initialValue = "Bread"

export default class List extends Component {
    componentWillMount() {
        this.setState({items: initialItems, value: initialValue})
    }

    render() {

        const listItems = []

        for(let i = 0; i < this.state.items.length; i++) {
          listItems.push(<ListItem item={this.state.items[i]} />)
        }

        return (
            <div>
                <input type="text"/>
                <button>Add</button>
                {listItems}
            </div>
        )
    }
}
